import React from 'react';
import { AppBar, Toolbar, Typography, Button} from '@material-ui/core';
import {Link} from 'react-router-dom';
import useStyles from './styles';
import ggsipu from '../../images/ggsipu.png';

const Navbar = () => {
    const classes = useStyles();
    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <img className={classes.image} src={ggsipu} alt="ggsipu" height="50" />
                <Typography component={Link} to="/"  className={classes.heading} variant="h4" align="center">GGSIPU</Typography>
            </div>
            <Toolbar className={classes.toolbar}>
                <Typography className={classes.userName} variant="h6" ></Typography>
                <Button component={Link} to="/auth" variant="contained" className={classes.logout} color="secondary">Sign In</Button>
            </Toolbar> 
        </AppBar>
    )
};

export default Navbar;
